def my_func(input1: str):
    if not (1 <= len(input1) <= 20):
        return None
    words = input1.split()
    result = []
    for word in words:
        parts = word.split('-')
        transformed = parts[0] + ''.join(part.capitalize() for part in parts[1:])
        result.append(transformed)
    return ' '.join(result)
